import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './pages/HomePage';
import Main from './sections/Main';  // Main sayfası
import About from './sections/About';  // About sayfası
import Contact from './sections/Contact';  // Contact sayfası

const App = () => {
  return (
    <Router>
      <Routes>
        {/* HomePage, yani ana sayfa */}
        <Route path="/" element={<HomePage />} />
        
        {/* Main Sayfası */}
        <Route path="/main" element={<Main />} />
        
        {/* About Sayfası */}
        <Route path="/about" element={<About />} />
        
        {/* Contact Sayfası */}
        <Route path="/contact" element={<Contact />} />
      </Routes>
    </Router>
  );
};

export default App;
